--
-- Triggers `pets`
--
DELIMITER $$
CREATE TRIGGER `after_pet_delete` AFTER DELETE ON `pets` FOR EACH ROW BEGIN
    UPDATE shelter 
    SET pets_count = pets_count - 1 
    WHERE shelter_id = OLD.shelter_id;
END
$$
DELIMITER ;
DELIMITER $$
CREATE TRIGGER `after_pet_insert` AFTER INSERT ON `pets` FOR EACH ROW BEGIN
    UPDATE shelter 
    SET pets_count = pets_count + 1 
    WHERE shelter_id = NEW.shelter_id;
END
$$
DELIMITER ;

